(1, '<p>Somos una empresa importadora, dedicada a la comercialización, representación y distribución al por mayor y al por menor de toda clase de partes de equipos de cómputo. Nuestra empresa cuenta con 15 años en el mercado brindando solides, seriedad y responsabilidad en nuestros servicios y productos.</p><p>Ofrecemos a nuestros clientes productos a la vanguardia en tecnología. Nuestro personal idóneo está dispuesto a brindarle asesoría en los productos de acuerdo a sus necesidades.</p><p>Además, contamos con un equipo de servicio técnico especializado, dando soporte de forma inmediata a sus requerimientos.</p>', '<p>Somos una compañía dedicada a la venta y distribución de toda clase de productos tecnológicos a la vanguardia y de excelente calidad, entregados con eficiencia y eficacia. Para lo cual, contamos con un equipo de profesionales idóneos y calificados, enfocados a proveer servicios de excelencia con el firme propósito de complacer a nuestros clientes en todas sus necesidades.</p>', '<p>Para el 2021 estaremos consolidados como una compañía líder en tecnología, reconocida por su compromiso, innovador del mercado, para brindarle solución a nuestros clientes con el fin de satisfacer sus necesidades.</p><p> Con todo esto obtendremos presencia internacional y reconocimiento, logrando así una compañía que beneficie el desarrollo del país.</p>', '<div class=\"row\"><div class=\"col s12\"><p>Nuestra empresa está enmarcada por 3 valores importantes, estos hacen que seamos destacados y mejores cada día:</p></div></div><div class=\"col s4 center\"><b>Responsabilidad social</b></div><div class=\"col s4 center\"><b>Integridad</b></div><div class=\"col s4 center\"><b>Calidez humana</b></div>');
