(1227, '5164', 'Freidora De Aire 2.5 Litros', 'freidora de aire, electrodomesticos, tecno, coccion, cocina, papas, fritos,salud, comida', 'ELECTRODOMESTICOS', 'FOLLOW ME', '<p style=\"text-align: justify;\">Con la freidora Air Fryer Follow me podras realizar deliciosos alimentos fritos, con un 99,5% menos aceite, has una cocci&oacute;n sin olores, puedes controlar la temperatura en su panel digital, viene con olla exterior y bandeja de cesta removible.</p>\r\n<div class=\"tt-collapse-title\"><strong>Caracteristicas</strong></div>\r\n<div class=\"tt-collapse-content\">\r\n<ul type=\"&rdquo;A&rdquo;\">\r\n<li>* 99.5% Menos Aceite</li>\r\n<li>* Cuida tu cuerpo y salud</li>\r\n<li>* R&aacute;pido, f&aacute;cil y seguro</li>\r\n<li>* Libre de olores, humo y residuos</li>\r\n<li>* La cocci&oacute;n perfecta, jugosa y crujiente</li>\r\n<li>* Sin Salpicaduras</li>\r\n<li>* Reduce el tiempo en la cocina</li>\r\n<li>* Temporizador de cocci&oacute;n</li>\r\n<li>* Pantalla digital y t&aacute;ctil</li>\r\n<li>* F&aacute;cil de limpiar</li>\r\n<li>* Temperatura ajustable</li>\r\n<li>* Apagado de seguridad autom&aacute;tico</li>\r\n</ul>\r\n</div>\r\n<p><strong><em>&iexcl;Disfruta tu comida saludable!</em></strong></p>\r\n<p><strong>Datos T&eacute;cnicos</strong></p>\r\n<table border=\"1\" style=\"border-collapse: collapse; width: 41.3008%;\" height=\"91\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 50%;\"><strong>Voltaje:</strong></td>\r\n<td style=\"width: 50%;\">(120V)- 50/60Gz</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%;\"><strong>Potencia:</strong></td>\r\n<td style=\"width: 50%;\">1000 Watts</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%;\"><strong>Capacidad:</strong></td>\r\n<td style=\"width: 50%;\">2.5 Litros</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%;\"><strong>Temperatura:</strong></td>\r\n<td style=\"width: 50%;\">80 &deg;C -200 &deg;C&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%;\"><strong>Temporizador:</strong></td>\r\n<td style=\"width: 50%;\">(0-60 min)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Componentes</strong></p>\r\n<p>Color: Negro</p>\r\n<p>Canasta: Aluminio antiadherente (antistick coatin basket)</p>\r\n<p>Cobertura de aluminio y pl&aacute;stico</p>', '1 año freidora - 6 meses en panel táctil ', 210000, 6, 0, NULL, 'cocina', 0, 0, NULL, NULL);
