(1256, '3009', 'Disco Externo 2TB Toshiba 3.0', 'disco duro, portable, portatil, disco, toshiba, disco externo, externo, solido, estado solido', 'DISCOS DUROS', 'TOSHIBA', 'Transfiere archivos rápidamente con la tecnología SuperSpeed USB 3.0 y almacena hasta 2 TB de datos en tu disco duro externo. Este dispositivo está listo para funcionar con sistemas operativos como Microsoft Windows y no requiere la instalación de ningún software; por lo que almacenar todos tus archivos favoritos es más fácil que nunca. Su diseño atractivo con acabado mate le proporciona un aspecto increíble tanto en tu escritorio como en cualquier otro lugar. Además; este disco duro se puede conectar a hardware antiguo gracias a la compatibilidad con USB 2.0.', '6 meses', 305000, 6, 0, NULL, 'portatiles, computadores, laptop, desktop, mac, macbook, toshiba, acer, lg, saamsung, sony, dell, asus, allienware, huawei', 0, 0, NULL, NULL),
(1257, '4609', 'Disco Externo 2TB Adata 3.0 Antigolpes', 'disco duro, portable, portatil, disco, toshiba, disco externo, externo, solido, estado solido, adata', 'DISCOS DUROS', 'ADATA', 'Rápido y seguro tus datos en una carcasa dura y deportiva. La carcasa del HD710 es de un material de silicona único, y la unidad incorpora una construcción impermeable y resistente a golpes de grado militar (IP68) con una interfaz USB 3.0 ultrarrápida y almacena hasta 2 TB de datos en tu disco duro externo. Su aspecto vivo y diseño dinámico se ajustan a los requisitos y estilo de los entusiastas del deporte y el aire libre. Transfiere archivos rápidamente con la tecnología SuperSpeed USB 3.0.', '6 meses', 342000, 5, 0, NULL, 'portatiles, computadores, laptop, desktop, mac, macbook, toshiba, acer, lg, saamsung, sony, dell, asus, allienware, huawei, adata', 0, 0, NULL, NULL),
