(1274, '5144', 'Memoria Ddr4 8gb Para Portátil ADATA (2666)', 'memoria, ddr4, 4gb, portatil, kingstone, 2666, velocidad', 'MEMORIAS', 'ADATA', 'Memoria RAM para Portátil DDR4 8GB 2666 \r\nLos módulos DDR4 ADATA para portátiles aprovechan ventajas de la nueva generación de alta fiabilidad. DDR4 ofrece un mayor rendimiento gracias a frecuencias más rápidas en comparación con la anterior generación DDR3, subiendo hasta 2666. \r\nLa DDR4 de ADATA ofrece múltiples ventajas sobre generaciones anteriores DRAM; ofrece la más alta calidad y el rendimiento más rápido. Viene equipada con 8 Gb para una actualización rápida y fácil en cualquier portátil compatible. Ofrecen transferencias de datos más rápidas que DDR3, además de un menor consumo de energía lo cual ayuda a la reducción del calor.', '6 meses', 142000, 7, 0, 'verde', 'portatiles, acer, sony, toshiba, janus, lg, samsung, lenovo, dell, asus, hp', 0, 0, NULL, NULL),
(1275, '4726', 'Memoria Ddr4 8gb Para PC ADATA 2666', 'memoria, ddr4, 4gb, portatil, kingstone, 2666, velocidad, pc', 'MEMORIAS', 'ADATA', 'Memoria RAM para PC DDR4 8GB 2666 \r\nLos módulos DDR4 ADATA para PC aprovechan ventajas de la nueva generación de alta fiabilidad. DDR4 ofrece un mayor rendimiento gracias a frecuencias más rápidas en comparación con la anterior generación DDR3, subiendo hasta 2666. \r\n\r\nLa DDR4 de ADATA ofrece múltiples ventajas sobre generaciones anteriores DRAM; ofrece la más alta calidad y el rendimiento más rápido. Viene equipada con 8 Gb para una actualización rápida y fácil en cualquier PC compatible. Ofrecen transferencias de datos más rápidas que DDR3, además de un menor consumo de energía lo cual ayuda a la reducción del calor.', '6 meses', 142000, 7, 0, 'verde', 'pc, acer, sony, toshiba, janus, lg, samsung, lenovo, dell, asus, hp', 0, 0, NULL, NULL),
(1276, '5191', 'Adaptador de Viaje Universal', 'cargador, viajero, universal, adaptador, carga, viaje', 'CARGADORES', 'UNIVERSAL', 'Adaptador enchufe de viaje universal dos puertos USB sirve para más de 150 países.\r\n\r\nFunciona en todo el mundo: (enchufes de UK / US / AU / EU), es compatible con más de 150 países del mundo en los Estados Unidos, Alemania, Europa, Francia, Polonia, Suiza, Italia, Japón, China, Australia y España. Este adaptador de viaje ofrece compatibilidad estupenda, es el ideal para cada viaje.\r\n\r\nDos puertos de USB: Carga rápida, no requiere cargadores múltiples en los viajes. Enchufe de adaptador internacional simple y potente permite el uso de toma de corriente CA y dos puertos USB, la corriente máxima de 2.4A. Aplica smartphones，tableta，Cámaras Digitales entre otros.', '3 meses', 65000, 4, 0, 'rojo', 'android, ios, USB, telefonos, tablets', 0, 0, NULL, NULL),
(1277, '4526', 'Convertidor HDMI 3 en 1 OTN7593', 'convertidor, pc, hdmi, tv, tecno', 'CONVERTIDORES', 'UNIVERSAL', 'Convertidor HDMI 3 en 1 - 4K ultra HD; carcasa diseñada en ABS destacada de alta resistencia de dimensiones 80 x 55 x 17 mm; tiene resolución de 1080P / 4K * 2K Chip: chip de conversión digital de alto rendimiento Entrada: HDMI Salida: HDMI.', '3 meses', 38000, 4, 0, 'negro', 'pc, acer, sony, toshiba, janus, lg, samsung, lenovo, dell, asus, hp', 0, 0, NULL, NULL),
(1278, '4524', 'Adaptador LIGTHNING a HDMI OT7565S', 'convertidor, pc, hdmi, tv, tecno, ligthning, mac, ios, ipad, iphone', 'CONVERTIDORES', 'UNIVERSAL', 'El adaptador soporta TV, pantalla, proyector equipado con HDMI, salida de contenido de vídeo - películas, programas de televisión, vídeo capturado a tu gran pantalla en hasta 1080p HD\r\nPLUG & PLAY, no requiere ningún ajuste o dispositivo adicional.\r\nEste adaptador AV digital se conecta a dispositivos iOS con un monitor HDTV con el cable original de dispositivos iOS.\r\nCompatible con dispositivos iOS (teléfono o tableta iOS).', '3 meses', 50000, 6, 0, 'gris', 'mac, iphone, ios, ipad', 0, 0, NULL, NULL),
(1279, '4523', 'Adaptador Tipo C A VGA-HDMI+USB3,0+PD OTN9163', 'adaptador, convertidor, cable, accesorios, celulares, celular, teléfono, teléfonos, datos, hdmi, tipo c, vga, hdmi, usb, otn9163', 'CONVERTIDORES', 'UNIVERSAL', 'Diseñado para profesionales, el Dock móvil tipo C es ideal cuando viaja y necesita un entorno productivo. La base permite que su portátil Tipo-C muestre video a un monitor o proyector HD 1080P, ofrece expansión de puerto USB para un mouse, teclado o dispositivo de memoria. El diseño permite que el cable tipo C se guarde perfectamente en el muelle cuando no está en uso, lo que proporciona una mejor movilidad. La estación de acoplamiento es compatible con los sistemas Windows, Mac y Chrome, así como con los 3 puertos Thunderbolt.', '3 meses', 100000, 6, 0, 'negro', 'pc, acer, sony, toshiba, janus, lg, samsung, lenovo, dell, asus, hp', 0, 0, NULL, NULL),
(1280, '4525', 'Adaptador Mini Display Port A Device+VGA+DVI OT3245', 'adaptador, convertidor, cable, accesorios, celulares, celular, teléfono, teléfonos, datos, hdmi', 'CONVERTIDORES', 'UNIVERSAL', 'Adaptador de viaje le permite conectar su portátil equipado con mDP a cualquier pantalla VGA o HDMI. Incluye salidas VGA DVI y HDMI, a fin de poder conectar la salida mDP de su computador portátil a cualquier pantalla de una sala de juntas o un aula moderna: solución plug-and-play ideal cuando es necesario traer el equipo propio al trabajar en una oficina; el conversor es compatible con resoluciones de video de hasta 1920x1200 o 1080p, es posible convertir una fuente de video Mini DisplayPort a HDMI, VGA o DVI, sin que desmejore la calidad del video.', '3 meses', 50000, 7, 0, 'blanco', 'pc, acer, sony, toshiba, janus, lg, samsung, lenovo, dell, asus, hp', 0, 0, NULL, NULL),
(1281, '8320', 'Xiaomi Redmi Note 9/4gb/128gb Polar White', 'xiaomi, smartphone, powerbank, cargador, cargadores, accesorios, carga, celulares, celular, teléfono, teléfonos, android', 'CELULARES', 'XIAOMI', '<p style=\"text-align: justify;\">El REDMI NOTE 9 cuenta con una gran cámara de 48MP para buscar los detalles en cualquier captura, su cámara de 8MP permite ampliar tu mundo fotográfico siendo ideal para paisajes y lograr los más mínimos detalles en una fotografía si es posible, gracias a su cámara macro de 2MP. Todo esto de la mano con su nuevo procesador Helio G85 el cual se ha caracterizado por ser revolucionario en su segmento y su gran batería de 5020mAh hace de él un celular extraordinario por su precio. </p>\r\n\r\n<strong> PANTALLA: </strong> LCD de 6,53 pulgadas (19.5:9) FullHD+ (2.340 x 1.080 píxeles)\r\n</br>\r\n<strong> PROCESADOR: </strong> Helio G85\r\n</br>\r\n<strong> RAM: </strong> 4 Gb\r\n</br>\r\n<strong> ALMACENAMIENTO: </strong> 128 GB + microSD hasta 512 GB (No incluida)\r\n</br>\r\n<strong> SOFTWARE: </strong> Android 10 + MIUI\r\n</br> \r\n<strong> CÁMARA FRONTAL: </strong> 13 MP f/2.25 \r\n</br>\r\n<strong> CÁMARA TRASERA: </strong> 48 MP f/1.79, AF - 8 MP f/2.2, gran angular (118°) - 2 MP macro, AF 2 cm - 2 MP profundidad\r\n</br>\r\n<strong> BATERÍA: </strong> 5.020 mAh con carga rápida 18 W \r\n</br>\r\n<strong> CONECTIVIDAD: </strong> Dual 4G, WiFi 5, Bluetooth 5.0, NFC, USB-C, jack 3,5 mm, infrarrojos\r\n</br>\r\n<strong> DIMENSIONES Y PESO: </strong> 162.3 x 77.2 x 8.9 mm - 199 g\r\n</br>\r\n', '1 año', 674000, 6, 0, NULL, 'android, Bluetooth', 1, 0, '6zLcdSV_te4', NULL),
