(1334, '8323', 'Xiaomi Redmi Note 9s - 6Gb -128Gb Interstellar Grey', 'xiaomi, smartwatch, reloj, reloj inteligente, smartphone, powerbank, cargador, cargadores, accesorios, carga, celulares, celular, teléfono, teléfonos', 'CELULARES', 'XIAOMI', '<p style=\"text-align: justify;\"> El REDMI NOTE 9s cuenta con una gran cámara de 48 MP con IA para buscar los detalles en cualquier captura, su cámara de 8 MP permite ampliar tu mundo fotográfico siendo ideal para paisajes y lograr los más mínimos detalles en una fotografía si es posible, gracias a su cámara macro de 5 MP y un sensor de profundidad de 2 MP. Todo esto de la mano con su nuevo procesador Qualcomm® Snapdragon™ 720G, Procesador de ocho núcleos de alto rendimiento, Frecuencia: hasta 2.3GHz, Procesador gráfico Adreno™ 618, IA de 5ª generación de Qualcomm y con Tecnología de proceso de 8nm. Se ha caracterizado por ser revolucionario en su segmento y su gran batería de 5020 mAh que soporta carga rápida de 18 W; hace de él un celular extraordinario. </p>\r\n\r\n<strong> PANTALLA: </strong> LCD de 6,67 pulgadas 2400 x 1080 FullHD+\r\n</br>\r\n<strong> PROCESADOR: </strong> Qualcomm® Snapdragon™ 720G\r\n</br>\r\n<strong> RAM: </strong> 6 Gb\r\n</br>\r\n<strong> ALMACENAMIENTO: </strong> 128 GB + microSD hasta 512 GB (No incluida)\r\n</br>\r\n<strong> SOFTWARE: </strong> Android 10 + MIUI\r\n</br> \r\n<strong> CÁMARA FRONTAL: </strong> 16 MP f/2.48 \r\n</br>\r\n<strong> CÁMARA TRASERA: </strong> 48 MP principal - 8 MP gran angular - 5 MP macro - 2 MP profundidad.\r\n</br>\r\n<strong> BATERÍA: </strong> 5.020 mAh con carga rápida 18 W \r\n</br>\r\n<strong> CONECTIVIDAD: </strong> Dual 4G, WiFi 5, Bluetooth 5.0, NFC, USB-C, jack 3,5 mm, infrarrojos\r\n</br>\r\n<strong> DIMENSIONES Y PESO: </strong> Altura: 165.75 mm, Ancho: 76.68 mm, Grosor: 8.8 mm - Peso: 209 g\r\n</br>\r\n\r\n', '1 año telefono - 6 meses de batería y cargador', 811000, 5, 0, 'gris', 'xiaomi, android', 0, 0, NULL, NULL),
